import {connect} from 'react-redux'
import Post from '../components/Post'


function mapStateToProps(state, ownProps) {
    console.log('mapStateToProps  POST');
    console.log(ownProps);
    console.log(state);
    return {
       data: {
           title: ownProps.title,
           text: ownProps.text,
           id: ownProps.id,
       }
    }
}

export default connect(
    mapStateToProps,
)(Post)
